import React from 'react';
import { Container,Row,Col } from 'react-bootstrap';
import { useSelector } from 'react-redux';
import ClientCard from './ClientCard';
import { Link } from 'react-router-dom';
import "./ClientList.css"

const ClientList = () => {
    const clientDataSelector = useSelector(state=>state.client.clientData);
    console.log(clientDataSelector);
    return (
        <>
        <div className='ClientList d-flex '>
                {clientDataSelector && clientDataSelector.map(client => <Link to={`/client/${client.Id}`} key={client.Id} style={{ color: 'inherit', textDecoration: 'inherit'}}><ClientCard  client={client}/></Link>)}

            
            </div>
            
        </>
    );
}

export default ClientList;
